package screen;

public class ChiNhanh {
	private String MaCN, TenCN, SoFax, maTP, maQuan, maPhuong, maDuong, maTruongCN;
	public ChiNhanh() {
		// TODO Auto-generated constructor stub
	}
	
	public ChiNhanh(String MaCN, String TenCN, String SoFax, String maTP, String maQuan, String maPhuong, String maDuong, String maTruongCN) {
		// TODO Auto-generated constructor stub
		this.MaCN = MaCN;
		this.TenCN = TenCN;
		this.SoFax = SoFax;
		this.maTP = maTP;
		this.maQuan = maQuan;
		this.maPhuong = maPhuong;
		this.maDuong = maDuong;
		this.maTruongCN = maTruongCN;
	}

	public String getMaCN() {
		return MaCN;
	}

	public void setMaCN(String maCN) {
		MaCN = maCN;
	}

	public String getTenCN() {
		return TenCN;
	}

	public void setTenCN(String tenCN) {
		TenCN = tenCN;
	}

	public String getSoFax() {
		return SoFax;
	}

	public void setSoFax(String soFax) {
		SoFax = soFax;
	}

	public String getMaTP() {
		return maTP;
	}

	public void setMaTP(String maTP) {
		this.maTP = maTP;
	}

	public String getMaQuan() {
		return maQuan;
	}

	public void setMaQuan(String maQuan) {
		this.maQuan = maQuan;
	}

	public String getMaPhuong() {
		return maPhuong;
	}

	public void setMaPhuong(String maPhuong) {
		this.maPhuong = maPhuong;
	}

	public String getMaDuong() {
		return maDuong;
	}

	public void setMaDuong(String maDuong) {
		this.maDuong = maDuong;
	}

	public String getMaTruongCN() {
		return maTruongCN;
	}

	public void setMaTruongCN(String maTruongCN) {
		this.maTruongCN = maTruongCN;
	}
	
	

}
